function ClientServices() {
    return (
        <div>
           <div>
                <div className="MainHeaderContent">
                    <h1 className="MainHeaderClient">
                        Client Services
                    </h1>
                    <div className="ColorBarClientServices"></div>
                </div>
                <div>
                    <h3 className="MainHeaderSlogan">
                        Innovation, Collaboration, and Commitment to Excellence, through our Meticulous <br/> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;efforts and Critical Thinking we set the bar in Customer Satisfaction
                    </h3>
                </div>
           </div> 
        </div>
    );
  }
  
  export default ClientServices;
